import { Button, Col, Row } from 'react-bootstrap';
import React from 'react';
import '../App.css';

export default function Welcome() {
  return (
   <Col lg="4" className='pt-2 pb-2 mb-5  rounded segundoColor '>

        <Row className='bg-primary'>


        <p className='text-dark  h5 text-center '>Bienvenido Gabriel{sessionStorage.getItem('Username')}</p>
        <Button  variant='danger' className='text-center rounded-pill '>Out</Button>


        </Row>
   </Col>
  )
}
